function StreamLightingPacketChanneled(count, data, channel){

    var packetNumber = 0
    let totalLedCount = count;
    for(var packetNumber = 0; packetNumber < 2; packetNumber++ ) {

        var ledsToSend = totalLedCount >= 60 ? 60 : totalLedCount;
        totalLedCount -= ledsToSend;

        var packet = [];
        packet[0] = 0x22;
        packet[1] = 0x10 | packetNumber;
        packet[2] = 0x01 << channel;
        packet[3] = 0x00;
        packet = packet.concat(data.splice(0,ledsToSend));
    
        device.write(packet,64);
        //device.read(packet,64);
    }
}
function sendchannelPumpColors(channel, shutdown = false){

    var RGBdata = [];
    var TotalLedCount = 0;
    for(var iIdx = 0; iIdx < vLedMap.length; iIdx++)
    {
        var iPxX = vLedPositions[iIdx][0];
        var iPxY = vLedPositions[iIdx][1];
        var col;
        if(shutdown){
            col = hexToRgb(shutdownColor)
        }else if (LightingMode == "Forced") {
            col = hexToRgb(forcedColor)
        }else{
            col = device.color(iPxX, iPxY);
        }           
        RGBdata[vLedMap[iIdx]*3] = col[1];
        RGBdata[vLedMap[iIdx]*3 + 1] = col[0];
        RGBdata[vLedMap[iIdx]*3 + 2] = col[2];
        TotalLedCount += 3;
    }
    StreamLightingPacketChanneled(TotalLedCount, RGBdata, channel);
    SubmitLightingColors(channel);
}
function sendchannel1Colors(channel, shutdown = false){

    var RGBdata = [];
    var TotalLedCount = 0;
    var propertyArray = [device1, device2,device3];

     //Fans
     for (var deviceNumber = 0; deviceNumber < propertyArray.length; deviceNumber++ ) {
           if(deviceValues[deviceNumber] != "None" && DeviceDict[propertyArray[deviceNumber]] != null){
              for(var iIdx = 0; iIdx < DeviceDict[propertyArray[deviceNumber]].mapping.length; iIdx++){
                  var iPxX = DeviceDict[propertyArray[deviceNumber]].positioning[iIdx][0];
                  var iPxY = DeviceDict[propertyArray[deviceNumber]].positioning[iIdx][1];
                  var mxPxColor;
                  //find colors
                  if(shutdown){
                      mxPxColor = hexToRgb(shutdownColor)
                  }else if (LightingMode == "Forced") {
                      mxPxColor = hexToRgb(forcedColor)
                  }else{
                      mxPxColor = device.subdeviceColor(deviceArray[deviceNumber],iPxX, iPxY);
                  } 
                   //set colors
                      RGBdata[DeviceDict[propertyArray[deviceNumber]].mapping[iIdx]*3+0+TotalLedCount*3] = mxPxColor[1];
                      RGBdata[DeviceDict[propertyArray[deviceNumber]].mapping[iIdx]*3+1+TotalLedCount*3] = mxPxColor[0];
                      RGBdata[DeviceDict[propertyArray[deviceNumber]].mapping[iIdx]*3+2+TotalLedCount*3] = mxPxColor[2];
                  }
                  TotalLedCount += DeviceDict[propertyArray[deviceNumber]].ledCount;
              }
  }

        StreamLightingPacketChanneled(TotalLedCount*3, RGBdata, channel);
        SubmitLightingColors(channel);

}
